ai","type":"address"},{"internalType":"string","name":"dataNascimento","type":"string"},{"internalType":"string","name":"naturalidade","type":"string"},{"internalType":"string","name":"nacionalidade","type":"string"},{"internalType":"string","name":"sexo","type":"string"},{"internalType":"bool","name":"changed","type":"bool"}],"internalType":"struct Database.Person","name":"","type":"tuple"}],"stateMutability":"view","type":"function"},{"inputs":[{"internalType":"address","name":"","type":"address"}],"name":"idChain","outputs":[{"internalType":"string","name":"name","type":"string"},{"internalType":"uint256","name":"cpf","type":"uint256"},{"internalType":"uint256","name":"id","type":"uint256"},{"internalType":"address","name":"mae","type":"address"},{"internalType":"address","name":"pai","type":"address"},{"internalType":"string","name":"dataNascimento","type":"string"},{"internalType":"string","name":"naturalidade","type":"string"},{"internalType":"string","name":"nacionalidade","type":"string"},{"internalType":"string","name":"sexo","type":"string"},{"internalType":"bool","name":"changed","type":"bool"}],"stateMutability":"view","type":"function"},{"inputs":[{"components":[{"internalType":"uint256","name":"digital","type":"uint256"}],"internalType":"struct Database.Digital","name":"digital","type":"tuple"}],"name":"recoverWallet","outputs":[{"internalType":"address","name":"wallet","type":"address"}],"stateMutability":"view","type":"function"},{"inputs":[],"name":"update","outputs":[],"stateMutability":"nonpayable","type":"function"}],"devdoc":{"kind":"dev","methods":{},"version":1},"userdoc":{"kind":"user","methods":{},"version":1}},"settings":{"compilationTarget":{"contracts/Database.sol":"Database"},"evmVersion":"london","libraries":{},"metadata":{"bytecodeHash":"ipfs","useLiteralContent":true},"optimizer":{"enabled":true,"runs":200},"remappings":[]},"sources":{"contracts/Database.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

contract Database {

    bool notification;

    struct Person {
        string name;
        uint256 cpf;
        uint256 id;
        address mae;
        address pai;
        string dataNascimento;
        string naturalidade;
        string nacionalidade;
        string sexo;
        bool changed;
    }

    struct Horario {
        string hora;
        string minuto;  
    }

    struct Digital {
        uint256 digital;
    }

    struct Local {
        string complemento;
        string municipio;
        string uf;
    }

    struct Data {
        string dia;
        string mes;
        string ano;
    }

    struct DocumentNascimento {
        uint256 matricula;
        Local localNascimento;
        Local localRegistro;
        Horario horaNascimento;
        Data dataRegistro;
        string numeroDNV;
    }

    modifier onlyAdmin {
        require(admins[msg.sender] == true, "You are not an admin!");
        _;
    }

    constructor() {
        admins[msg.sender] = true;
    }

    mapping(address => bool) public admins;

    mapping(address => Person) public idChain;

    mapping(uint256 => address) digitalChain;

    mapping(address => DocumentNascimento) documentNascimentoChain;


    function getPersonByWallet(address _wallet) public view onlyAdmin returns(Person memory person){
        require(idChain[_wallet].cpf != 0, "This person is not registred!");
        return idChain[_wallet];
    }

    function addAdmin(address _wallet) public onlyAdmin {
        require(idChain[_wallet].cpf != 0, "This person is not registred!");
        admins[_wallet] = true;
    }

    function editName(address _wallet, string memory _newName) public onlyAdmin {
        require(idChain[_wallet].cpf != 0, "This person is not registred!");
        idChain[_wallet].name = _newName;
        idChain[_wallet].changed = true;
    }

    function recoverWallet(Digital memory digital) public view onlyAdmin returns(address wallet) {
        return(digitalChain[digital.digital]);
    }

    function addPerson(address _wallet, Person memory person) public onlyAdmin {
        idChain[_wallet] = person;
    }

    function getPersonData() public view returns(Person memory) {
        return idChain[msg.sender];
    }

    function update() public {
        if(idChain[idChain[msg.sender].mae].changed == true || idChain[idChain[msg.sender].pai].changed == true) {
            notification = true;
        }
        idChain[idChain[msg.sender].mae].changed = false;
        idChain[idChain[msg.sender].pai].changed = false;
    }

    function addDocumentNascimento(
        address wallet,
        uint256 matricula,
        Local memory localNascimento,
        Local memory localRegistro,
        Horario memory horaNascimento,
        Data memory dataRegistro,
        string memory numeroDNV
    ) public onlyAdmin {
        documentNascimentoChain[wallet] = DocumentNascimento(
            matricula,
            localNascimento,
            localRegistro,
            horaNascimento,
            dataRegistro,
            numeroDNV);
    }
}","keccak256":"0xb3c268a34f3f5bac594c34df7519ba0488b51c7dab32fa2066519846913c8828","license":"MIT"}},"version":1}
